import React from 'react';

interface Props {
	id: string;
}

export const Button = ({ id }: Props) => {

	switch (id) {
		case 'button_CreateTask':
			return (
				<button><p>LOG OUT</p></button>
			)

		// case 'button_LogOut':
		// 	return (
